import react from 'react';
import { ListGroup, ListGroupItem } from 'reactstrap';
import { Link } from 'react-router-dom';

const Menus = () => {
    return (
        <ListGroup>
            <Link className="list-group-item list-group-item-action" to="/">Home</Link> 
            <Link className="list-group-item list-group-item-action" to="#">IDE</Link> 
            <Link className="list-group-item list-group-item-action" to="#">Compile</Link> 
            <Link className="list-group-item list-group-item-action" to="#">Contact</Link> 

        </ListGroup>
    )
}

export default Menus
